import React from 'react';
import Paper from '@material-ui/core/Paper';
import Button from '@material-ui/core/Button';

import TextField from '@material-ui/core/TextField';
import {
  Link
} from "react-router-dom";
const LoginPage = () => {

  const styles = {
    loginContainer: {
      minWidth: 320,
      maxWidth: 400,
      height: 'auto',
      position: 'absolute',
      top: '20%',
      left: 0,
      right: 0,
      margin: 'auto'
    },
    paper: {
      padding: 20,
      overflow: 'auto'
    },
    buttonsDiv: {
      textAlign: 'center',
      padding: 10
    },
    flatButton: {
      color: 'grey'
    },
    checkRemember: {
      style: {
        float: 'left',
        maxWidth: 180,
        paddingTop: 5
      },
      labelStyle: {
        color: 'grey'
      },
      iconStyle: {
        color: 'grey',
        borderColor: 'grey',
        fill: 'grey'
      }
    },
    loginBtn: {
      float: 'right'
    },
    btn: {
      background: '#4f81e9',
      color: 'white',
      padding: 7,
      borderRadius: 2,
      margin: 2,
      fontSize: 13
    },
    btnFacebook: {
      background: '#4f81e9'
    },
    btnGoogle: {
      background: '#e14441'
    },
    btnSpan: {
      marginLeft: 5
    },
  };



  return (
        <div style={styles.loginContainer}>

          <Paper style={styles.paper}>

            <form>
              <TextField
                placeholder="E-mail"
                fullWidth={true}
              />
              <TextField
                placeholder="Password"
                fullWidth={true}
                type="password"
              />

              <div>
                <Button onClick={handleLogin} style={styles.btn} variant="contained" color="secondary">
                  Sign In
                </Button>
              </div>
            </form>
          </Paper>
        </div>
  );
};

export default LoginPage;
